import "../assets/scss/_kanban.scss";
import KanbanColumn from "./KanbanColumn";

const Kanban = () => {
  const columnsData = {
    open: [
      {
        id: 1,
        title: "Task 1",
        description: "Description for Task 1",
        assignedTo: "User A",
      },
      {
        id: 2,
        title: "Task 2",
        description: "Description for Task 2",
        assignedTo: "User B",
      },
    ],
    ongoing: [
      {
        id: 3,
        title: "Task 3",
        description: "Description for Task 3",
        assignedTo: "User C",
      },
      {
        id: 4,
        title: "Task 4",
        description: "Description for Task 4",
        assignedTo: "User A",
      },
    ],
    close: [
      {
        id: 5,
        title: "Task 5",
        description: "Description for Task 5",
        assignedTo: "User B",
      },
      {
        id: 6,
        title: "Task 6",
        description: "Description for Task 6",
        assignedTo: "User C",
      },
    ],
  };

  return (
    <div className="kanban">
      <KanbanColumn id="open" tasks={columnsData.open} />
      <KanbanColumn id="ongoing" tasks={columnsData.ongoing} />
      <KanbanColumn id="close" tasks={columnsData.close} />
    </div>
  );
};

export default Kanban;
